import { io } from 'socket.io-client';


function Dashboard() {

    const [socket, setSocket] = useState();

    useEffect(() => {
        const s = io("http://localhost:3001");
        setSocket(s);
        console.log(socket)

        return () => {
            s.disconnect();
        }
    }, []) 

    return (
        <div className = "dashboard-container">
            <h1>Dashboard</h1>
            <div>
                <a href="https://normaly0.github.io/" target="_blank" >
                <iframe src="https://normaly0.github.io/" />
                </a>
            </div>
        </div>
    )
}

export default Dashboard;
